import React, { useEffect, useState } from "react";
import { useDispatch,useSelector} from "react-redux";
import { getPokemon,  } from "../Store/action";
import './pokemon.css';
import PokemonCard from "./PokemonCard";


export function PokemonGrid(){
    const[poke,setPoke]=useState('')
    const dispatch=useDispatch();
    setPoke=useSelector(store =>store.pokemon.pokemons)
    useEffect(() => {
        dispatch(getPokemon())
      }, []);
    
    dispatch(getPokemon)
    
   
    console.log(setPoke)


    return(
        <div className="box">   
           
            <ul className="box">
                {
                    poke.map((i) => <PokemonCard key={i.id}
                     
                    name={i.name}
                    tipos={i.types.map(e=>e)}
                    image={i.img}/> )
                            
                }
            </ul>
        </div>
    );
};
